// src/pages/admin/AdminHomePage.js
import React, { useState, useEffect } from 'react';
import './AdminHomePage.css';

const AdminHomePage = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalDocuments: 0,
    totalFolders: 0,
    storageUsed: 0
  });
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadAdminData = async () => {
      try {
        // Mock data - replace with actual API calls
        setStats({
          totalUsers: 150,
          totalDocuments: 1250,
          totalFolders: 320,
          storageUsed: 2.5 // GB
        });
        
        setUsers([
          { id: 1, username: 'john_doe', email: 'john@example.com', role: 'USER', status: 'active' },
          { id: 2, username: 'jane_smith', email: 'jane@example.com', role: 'USER', status: 'active' },
          // Add more mock users
        ]);
      } catch (error) {
        console.error('Failed to load admin data:', error);
      } finally {
        setLoading(false);
      }
    };

    loadAdminData();
  }, []);

  if (loading) {
    return <div className="loading-spinner">Loading...</div>;
  }

  return (
    <div className="admin-page">
      <div className="page-header">
        <h1>Admin Dashboard</h1>
        <p>System overview and user management</p>
      </div>

      <div className="admin-stats">
        <div className="stat-card">
          <div className="stat-icon">üë•</div>
          <div className="stat-info">
            <h3>{stats.totalUsers}</h3>
            <p>Total Users</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">üìÑ</div>
          <div className="stat-info">
            <h3>{stats.totalDocuments}</h3>
            <p>Total Documents</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">üìÅ</div>
          <div className="stat-info">
            <h3>{stats.totalFolders}</h3>
            <p>Total Folders</p>
          </div>
        </div>
        
        <div className="stat-card">
          <div className="stat-icon">üíæ</div>
          <div className="stat-info">
            <h3>{stats.storageUsed} GB</h3>
            <p>Storage Used</p>
          </div>
        </div>
      </div>

      <div className="admin-section">
        <h2>Recent Users</h2>
        <div className="users-table">
          <table>
            <thead>
              <tr>
                <th>Username</th>
                <th>Email</th>
                <th>Role</th>
                <th>Status</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {users.map(user => (
                <tr key={user.id}>
                  <td>{user.username}</td>
                  <td>{user.email}</td>
                  <td>
                    <span className={`role-badge ${user.role.toLowerCase()}`}>
                      {user.role}
                    </span>
                  </td>
                  <td>
                    <span className={`status-badge ${user.status}`}>
                      {user.status}
                    </span>
                  </td>
                  <td>
                    <button className="action-btn">Edit</button>
                    <button className="action-btn delete">Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default AdminHomePage;
